import React from "react";
import img from "../assets/book_sample.jpeg"

const SellUsedPage = () => {
  return (
    <div className="card__wrapper">
      <img src={img} className="card__img"></img>
      <p>BookName</p>
      <p>Authorname</p>
    </div>
  );
};

export default SellUsedPage;
